INSERT INTO `currency_types_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(3252, 'esES', 'Bronce', 'Un ápice de tiempo comprimido en una moneda de bronce. El Vuelo Infinito la intercambiará por recompensas estéticas.', 63906),
(3292, 'esES', 'Conocimiento infinito', 'Esencia de conocimiento coagulada procedente de otra línea temporal. El conocimiento infinito aumenta la cantidad de poder infinito que se extrae de la mayoría de las fuentes. El que se obtiene por encima del límite se convierte automáticamente en bronce.', 63906),
(3008, 'esES', 'Piedras de valor', 'Se obtiene al completar misiones, bandas, mazmorras, campos de batalla, combates de arena, ecos radiantes y otras actividades de nivel máximo. Se usa para mejorar el equipo de nivel máximo.', 63906);
