INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2683, 'esES', 'Corcel óseo del olvido', '|cFFFFD200Evento del mundo:|r WoW Remix: Legion', 'Un buen caballo de guerra es leal hasta los huesos. Como este corcel se ha deshecho de su envoltura mortal, ahora es un presagio de escasez y muerte.', 63906),
(2682, 'esES', 'Corcel óseo de la peste', '|cFFFFD200Evento del mundo:|r WoW Remix: Legion', 'Un buen caballo de guerra es leal hasta los huesos. Como este corcel se ha deshecho de su envoltura mortal, ahora es un presagio de enfermedades y sufrimiento.', 63906),
(2681, 'esES', 'Corcel óseo del derramamiento de sangre', '|cFFFFD200Evento del mundo:|r WoW Remix: Legion', 'Un buen caballo de guerra es leal hasta los huesos. Como este corcel se ha deshecho de su envoltura mortal, ahora es un presagio de un conflicto eterno.', 63906),
(2679, 'esES', 'Corcel óseo del triunfo', '|cFFFFD200Evento del mundo:|r WoW Remix: Legion', 'Un buen caballo de guerra es leal hasta los huesos. Como este corcel se ha deshecho de su envoltura mortal, ahora es un presagio de una conquista osada.', 63906),
(2732, 'esES', 'Cazador de fase cobalto', '|cFFFFD200Promoción:|r Burning Crusade Classic', 'A causa de las energías ultraterrenas que irradiaron sobre Draenor, estas criaturas tienen la facultad de trasladarse por el espacio, lo que hace que sea complicado verlas... hasta que es demasiado tarde.', 63906),
(2640, 'esES', 'Bombardero de la Fiesta de la Cerveza', '|cFFFFD200Botín:|r Coren Cerveza Temible|n|cFFFFD200Festividad:|r Fiesta de la Cerveza', 'Ten cuidado de no consumir la munición.', 63906),
(2566, 'esES', 'Cascada carmesí de Lana\'thel', '|cFFFFD200Tienda del juego|r ', 'El dominio de las artes sanguinas de la Reina de Sangre le permitió conjurar una sirvienta aterradora para que la llevase al campo de combate. Adornada con los colores distintivos de su corte, va tapada con un rostro aterrador y adornada con alas y garras para recordar la ira de su maestra.', 63906);
