INSERT INTO `ui_splash_screen_locale` (`ID`, `locale`, `Header_lang`, `TopLeftFeatureTitle_lang`, `TopLeftFeatureDesc_lang`, `BottomLeftFeatureTitle_lang`, `BottomLeftFeatureDesc_lang`, `RightFeatureTitle_lang`, `RightFeatureDesc_lang`, `VerifiedBuild`) VALUES
(85, 'esES', '¡Novedades del parche 11.2.0!', 'Sucesión ecológica', 'Ayuda a Ve\'nari y recoge criaturas de toda Azeroth para restaurar la vida en K\'aresh.', 'Ecodomo Al\'dani', '¡Defiende el ecodomo oculto y descubre los secretos ancestrales sellados en su interior!', 'K\'aresh', 'Adéntrate en los oscuros secretos del Vacío en el planeta perdido de los etéreos.', 63906),
(84, 'esES', '¡Novedades del parche 11.1.7!', 'Paseo por la historia', '¡Habla con el eremita Cho en una capital para revivir momentos emblemáticos de la historia!', 'Ayudante de combate', '¡Activa esta opción en el menú de configuración para que te ayuden con la rotación durante el combate!', '¡Profundidades sobrecargadas!', 'Potencia la maquinaria de los titanes para explorar aún más allá y enfrentarte a nuevos desafíos.', 63906),
(80, 'esES', '¡Novedades del parche 11.1.5!', 'Gestor de tiempos de reutilización', '¡Activa esta opción en el menú de configuración para hacer un seguimiento de tus tiempos de reutilización!', 'Próximamente: Dúos despiadados', '¡Enfréntate a un dúo de enemigos del pasado de Azeroth e intenta conseguir la puntuación máxima!', 'Regreso a las visiones horripilantes', '¡Regresa a las profundidades de la locura para disfrutar de nuevos desafíos y ganar nuevas recompensas!', 63906),
(76, 'esES', '¡Novedades del parche 11.1.0!', 'C.A.R.R.O.', '¡Disfruta de una nueva forma de viajar en Minahonda con el Rompecuellos G-99 personalizable!', 'Personaliza tu campamento', '¡Crea nuevos campamentos en la pantalla de selección de personaje y elige entre un conjunto de fondos desbloqueables!', 'Minahonda', 'Continúa la caza de Xal\'atath y enfréntate a las fuerzas de Gallywix en las bulliciosas calles de Minahonda.', 63906),
(73, 'esES', '¡Novedades de la temporada 1!', 'Empieza la temporada 1', '¡Consigue recompensas en mazmorras míticas y en el nuevo Campo de batalla relámpago puntuado!', 'Palacio Nerub\'ar', 'Asalta la sede del poder de la reina Ansurek en Azj-Kahet.', 'Guarida de Zekvir', 'Progresa en el nuevo contenido de profundidad de temporada para desbloquear la Guarida de Zekvir.', 63906),
(72, 'esES', '¡Novedad de The War Within!', 'Profundidades', 'Sumérgete en las profundidades, revela misterios y busca tesoros.', 'Talentos heroicos', '¡Amplía el trasfondo de tu clase y personaliza tu configuración de talentos!', 'The War Within', '¡Dirígete a Khaz Algar y acude a la llamada de la canción radiante!', 63906),
(71, 'esES', '¡Novedades del parche preliminar de The War Within!', 'Ecos radiantes', 'Derrota enemigos del pasado de Azeroth al resurgir recuerdos. ¡Disponible el 31 de julio!', 'Queda muy poco para The War Within', 'Disponible el 26 de agosto (acceso anticipado el 22 de agosto).', 'Bandas guerreras', '¡Tus personajes comparten acceso a un banco de bandas guerreras, reputaciones de Dragonflight y demás!', 63906),
(70, 'esES', 'Novedades del parche 10.2.7', 'Legado de los draenei y los trols', 'Consigue conjuntos de armadura exclusivos mientras exploras sus culturas e historias.', 'Remix de Pandaria', '¡La semana que viene llega una forma distinta de subir de nivel!', 'Presagista de oscuridad', 'Al volver la paz a las Islas Dragón, un plan oscuro se pone en marcha.', 63906),
(69, 'esES', '10.2.7 Mists of Pandaria: Remix', 'Consigue recompensas para la cuenta', '¡Consigue bronce y hazte con monturas, mascotas y apariencias!', 'Primeros pasos', 'Crea un nuevo asaltante temporal en la pantalla de selección de personaje.', 'Mists of Pandaria: Remix', '¡Disfruta de Mists of Pandaria con novedades de lo más interesantes!', 63906),
(68, 'esES', '', 'Obtén recompensas', '¡Consigue botín para obtener recompensas como monturas, mascotas y transfiguraciones!', 'Primeros pasos', 'Para jugar, desconéctate y selecciona Plunderstorm en la pantalla de selección de personaje.', 'Plunderstorm', '¡Los piratas se enfrentan en una batalla colosal!', 63906),
(64, 'esES', '¡Novedades de la temporada 4!', 'Temporada 4 de Dragonflight', 'Recibe nuevas recompensas.', 'Progresión de mazmorras actualizada', 'Recompensas de las dificultades heroica, mítica y mítica+ actualizadas.', 'Bandas despiertas', '¡Conquista las tres bandas de Dragonflight para obtener recompensas actualizadas!', 63906),
(63, 'esES', '¡Novedades del parche 10.2.5!', 'Archivo de Azeroth', 'Adéntrate en la historia perdida y las leyendas de las Islas Dragón.', 'Mazmorras con seguidores', '¡Haz cola para mazmorras de Dragonflight con compañeros PNJ!', 'Gilneas reclamada', 'Únete a Genn Cringrís y a los gilneanos para recuperar su hogar.', 63906),
(61, 'esES', '¡Novedades del parche 10.2.0!', 'Guardianes del Sueño', 'Únete a la defensa del Sueño con nuevos eventos, recompensas y vías de renombre.', 'Campo de batalla relámpago', '¡Únete a una experiencia de campo de batalla 8c8 en solitario! ¡En este modo, todo va rápido!', 'El Sueño Esmeralda', 'Entra en el Sueño y defiende Amirdrassil, el Árbol del Mundo floreciente, de Fyrakk y los druidas de la Llama.', 63906),
(60, 'esES', '¡Novedades del parche 10.1.7!', 'Armadura dinástica de elfos de la noche y Renegados', 'Consigue conjuntos de armadura exclusivos mientras exploras las culturas e historias de estas razas.', 'Presentación del sistema de avisos', 'Pásate por el menú de opciones para comunicarte más rápido con avisos.', 'Picos Oníricos', '¡Enfréntate a enemigos potenciados por el Sueño en las Islas Dragón mientras Amirdrassil se prepara para florecer!', 63906),
(59, 'esES', '¡Novedades del parche 10.1.5!', 'Aumento desbloqueado', '¡Una nueva especialización de daño con un estilo de juego único!', 'Desentraña las líneas temporales', '¡Ayuda al Vuelo Bronce en el Margen del Eón y las fallas temporales!', 'Amanecer del Infinito', '¡Lucha contra el Vuelo Infinito en una megamazmorra mítica!', 63906),
(58, 'esES', '¡Novedades de la temporada 2!', 'Temporada 2 de Dragonflight', 'Consigue nuevas recompensas en mazmorras de piedra angular mítica y JcJ.', 'Actualización de míticas+', '¡Disfruta de nuevos afijos y de una reserva renovada de mazmorras de mítica+!', 'Aberrus, el Crisol Ensombrecido', 'Persigue a Sarkareth y explora el legado de Neltharion en este antiguo laboratorio.', 63906),
(57, 'esES', '¡Novedades del parche 10.1.0!', 'Reptadraco sinuoso', '¡Recorre la Caverna Zaralek en la nueva montura nativa de jinete de dragones!', 'Hermandades multifacción', '¡Por primera vez, los jugadores de la Horda y la Alianza pueden unirse en la misma hermandad!', 'Caverna Zaralek', 'Continúa la historia de la Llama Hendida y enfréntate a las fuerzas de las Encarnaciones en este olvidado territorio subterráneo.', 63906),
(56, 'esES', '¡Novedades del parche 10.0.7!', 'Legado de los humanos y los orcos', 'Consigue conjuntos de armadura exclusivos mientras exploras las culturas e historias de estas razas.', 'Actualización de Recluta a un amigo', '¡Nuevas y fantásticas recompensa por traer a tus amigos a Azeroth!', 'Regreso al Confín Olvidado', 'Investiga los misterios que dejaron atrás los dracthyr durante su huida.', 63906),
(55, 'esES', '¡Novedades del parche 10.0.5!', 'La furia de la tormenta', 'Lucha contra los Primalistas en el Futuro Primalista para obtener recompensas épicas.', 'Actualizaciones de la transfiguración', '¡Ahora se pueden obtener objetos blancos y grises para la transfiguración!', '¡El puesto comercial ha abierto sus puertas!', 'Hay una nueva tienda de cosméticos en Ventormenta y Orgrimmar.', 63906),
(50, 'esES', '¡Novedades de la temporada 1!', 'Temporada 1 de JcJ', 'Consigue recompensas con el nuevo modo Batiburrillo de solitarios puntuados.', 'Temporada 1 de míticas+', 'Una nueva rotación de mazmorras y el afijo \"atronadora\" te aguardan.', 'Cámara de las Encarnaciones', 'Impide que los Primalistas liberen a los parientes encarcelados de Raszageth.', 63906),
(49, 'esES', '¡Novedades en Dragonflight!', 'Actualización de las profesiones', '¡Nuevas características, como pedidos de fabricación, equipo o especializaciones, entre otras muchas!', 'Jinete de dragones', 'Surca los cielos de las Islas Dragón con un nuevo y emocionante sistema de movimiento.', 'Islas Dragón', 'Viaja al hogar ancestral de los Vuelos y ayúdalos a recuperar su legado.', 63906);
